sjp69d45.en:
Deduction from the formula for calculating the sub-account amount: 
Headquarters: (transaction amount-handling fee) * total account ratio; 
Store: Order Amount-Handling Fee-Total Part Amount. 
External buckle: 
Headquarters: transaction amount * proportion of total part of the account; 
Shop: Order Amount-Total Part Account Amount.

57ht306u.en:
Calculation formula of sub-account amount: 
Internal buckle: 
Headquarters: (transaction amount-handling fee) * total account ratio; 
Dealer: (transaction amount-handling fee) * proportion of dealer account sharing; 
Store: Order Amount-Handling Fee-Total Partial Account Amount-Dealer Amount. 
External buckle: 
Headquarters: transaction amount * proportion of total part of the account; 
Dealer: Transaction amount * proportion of dealer's account sharing; 
Store: Order Amount-Total Partial Account Amount-Dealer Account Amount.

